import Head from 'next/head';
import Nav from '../components/Nav'; 
import Hamburger from '../components/Hamburger';

const Layout = (props) => (
    <div>
        <Head>
            <title>BitzPrice</title>
        </Head>
        <div>
            {props.children}
        </div>
        <Nav />
        <Hamburger />
    </div>
)

export default Layout;
